bool_t
xdr_fnClientDbStatistics_rets(xdrs, objp)
	register XDR *xdrs;
	fnClientDbStatistics_rets *objp;
{

	register long *buf;


	if (xdrs->x_op == XDR_ENCODE) {
		if (!xdr_bool_t(xdrs, &objp->ReturnValue))
			return (FALSE);
		buf = XDR_INLINE(xdrs, 7 * BYTES_PER_XDR_UNIT);
		if (buf == NULL) {
			if (!xdr_int(xdrs, &objp->pnMaximumSpace))
				return (FALSE);
			if (!xdr_int(xdrs, &objp->pnAllocatedSpace))
				return (FALSE);
			if (!xdr_int(xdrs, &objp->pnUnallocatedSpace))
				return (FALSE);
			if (!xdr_int(xdrs, &objp->pnUnusedAllocatedSpace))
				return (FALSE);
			if (!xdr_int(xdrs, &objp->pnAllocatedManagementSpace))
				return (FALSE);
			if (!xdr_int(xdrs, &objp->pnNumberOfObjects))
				return (FALSE);
			if (!xdr_int(xdrs, &objp->nErrorLvl))
				return (FALSE);

		} else {
			IXDR_PUT_LONG(buf, objp->pnMaximumSpace);
			IXDR_PUT_LONG(buf, objp->pnAllocatedSpace);
			IXDR_PUT_LONG(buf, objp->pnUnallocatedSpace);
			IXDR_PUT_LONG(buf, objp->pnUnusedAllocatedSpace);
			IXDR_PUT_LONG(buf, objp->pnAllocatedManagementSpace);
			IXDR_PUT_LONG(buf, objp->pnNumberOfObjects);
			IXDR_PUT_LONG(buf, objp->nErrorLvl);
		}
		if (!xdr_string_t(xdrs, &objp->pszErrorMsg))
			return (FALSE);
		return (TRUE);
	} else if (xdrs->x_op == XDR_DECODE) {
		if (!xdr_bool_t(xdrs, &objp->ReturnValue))
			return (FALSE);
		buf = XDR_INLINE(xdrs, 7 * BYTES_PER_XDR_UNIT);
		if (buf == NULL) {
			if (!xdr_int(xdrs, &objp->pnMaximumSpace))
				return (FALSE);
			if (!xdr_int(xdrs, &objp->pnAllocatedSpace))
				return (FALSE);
			if (!xdr_int(xdrs, &objp->pnUnallocatedSpace))
				return (FALSE);
			if (!xdr_int(xdrs, &objp->pnUnusedAllocatedSpace))
				return (FALSE);
			if (!xdr_int(xdrs, &objp->pnAllocatedManagementSpace))
				return (FALSE);
			if (!xdr_int(xdrs, &objp->pnNumberOfObjects))
				return (FALSE);
			if (!xdr_int(xdrs, &objp->nErrorLvl))
				return (FALSE);

		} else {
			objp->pnMaximumSpace = IXDR_GET_LONG(buf);
			objp->pnAllocatedSpace = IXDR_GET_LONG(buf);
			objp->pnUnallocatedSpace = IXDR_GET_LONG(buf);
			objp->pnUnusedAllocatedSpace = IXDR_GET_LONG(buf);
			objp->pnAllocatedManagementSpace = IXDR_GET_LONG(buf);
			objp->pnNumberOfObjects = IXDR_GET_LONG(buf);
			objp->nErrorLvl = IXDR_GET_LONG(buf);
		}
		if (!xdr_string_t(xdrs, &objp->pszErrorMsg))
			return (FALSE);
		return (TRUE);
	}

	if (!xdr_bool_t(xdrs, &objp->ReturnValue))
		return (FALSE);
	if (!xdr_int(xdrs, &objp->pnMaximumSpace))
		return (FALSE);
	if (!xdr_int(xdrs, &objp->pnAllocatedSpace))
		return (FALSE);
	if (!xdr_int(xdrs, &objp->pnUnallocatedSpace))
		return (FALSE);
	if (!xdr_int(xdrs, &objp->pnUnusedAllocatedSpace))
		return (FALSE);
	if (!xdr_int(xdrs, &objp->pnAllocatedManagementSpace))
		return (FALSE);
	if (!xdr_int(xdrs, &objp->pnNumberOfObjects))
		return (FALSE);
	if (!xdr_int(xdrs, &objp->nErrorLvl))
		return (FALSE);
	if (!xdr_string_t(xdrs, &objp->pszErrorMsg))
		return (FALSE);
	return (TRUE);
}

